  insertRecord(dbTable, Map<String, dynamic> row) async {
    Database? db = await instance.database;
    return await db?.insert(dbTable, row);
  }

  Future<int?> deleteRecord(
      {required String dbTable, required String where, required int id}) async {
    final Database? db = await instance.database;
    return await db?.delete(dbTable, where: where, whereArgs: [id]);
  }

  Future<int?> updateRecord(
      dbTable, Map<String, dynamic> updatedRow, String where, int id) async {
    final Database? db = await instance.database;
    return await db?.update(
      dbTable,
      updatedRow,
      where: where,
      whereArgs: [id],
    );
  }

  Future<int?> updateOrderItems(
      dbTable, Map<String, dynamic> updatedRow, int id) async {
    final Database? db = await instance.database;
    return await db?.update(
      dbTable,
      updatedRow,
      where: 'orderItemId = ?',
      whereArgs: [id],
    );
  }

  Future<void> updateStock(int productId, bool isIncrement) async {
    final db = await database;

    if (isIncrement) {
      await db!.rawUpdate(
          'UPDATE Products SET stock = stock - 1 WHERE productId = ?',
          [productId]);
    } else {
      await db!.rawUpdate(
          'UPDATE Products SET stock = stock + 1 WHERE productId = ?',
          [productId]);
    }
  }

// changeQuantity() AND changeIngredientQuantity() CAN BE MERGED INTO 1 FUNCTION
  Future<void> changeQuantity(int orderId, bool decrement) async {
    final int newQuantity;
    if (decrement == false) {
      newQuantity = (await getQuantity(orderId) + 1);
    } else {
      newQuantity = await getQuantity(orderId) - 1;
    }
    final Database? db = await instance.database;
    await db?.update(
      'OrderItems',
      {'quantity': newQuantity},
      where: 'orderItemId = ?',
      whereArgs: [orderId],
    );
  }

// changeQuantity() AND changeIngredientQuantity() CAN BE MERGED INTO 1 FUNCTION
  Future<void> changeIngredientQuantity(
      int purchaseItemId, bool decrement) async {
    final int newQuantity;
    if (decrement == false) {
      newQuantity = (await getIngredientQuantity(purchaseItemId) + 1);
    } else {
      newQuantity = await getIngredientQuantity(purchaseItemId) - 1;
    }
    final Database? db = await instance.database;
    await db?.update(
      'PurchaseItems',
      {'quantity': newQuantity},
      where: 'purchaseItemId = ?',
      whereArgs: [purchaseItemId],
    );
  }

  Future<List<OrderModel>?> getOrders({
    String? orderBy,
    int? limit,
    String? where,
    String? fromDate,
    String? toDate,
  }) async {
    final db = await database;
    final result = await db?.query(
      'Orders',
      orderBy: orderBy,
      limit: limit,
      where: where,
      whereArgs: fromDate == null && toDate == null ? null : [fromDate, toDate],
    );
    return result?.map((jsonOrder) {
      return OrderModel.fromJson(jsonOrder);
    }).toList();
  }

  Future<List<Map<String, Object?>>?> getRecord(
    String dbTable,
    String where,
    int id,
  ) async {
    final Database? db = await instance.database;
    return await db?.query(
      dbTable,
      where: where,
      whereArgs: [id],
    );
  }

  Future<CompanyModel> loadCompanyData(int id) async {
    final Database? db = await instance.database;
    // print('function');
    final List<Map<String, Object?>>? result = await db?.query(
      'Company',
      where: 'companyId = ?',
      whereArgs: [0],
    );

    // print('resss=${result}');
    // print('resss=${result[0]}');
    // print('Model=${CompanyModel.fromMap(result[0])}');
    return CompanyModel.fromMap(result![0]);
  }

  Future<UserModel?> loginCheck(String username, String password) async {
    final Database? db = await instance.database;
    final List<Map<String, Object?>>? result = await db?.query(
      'Users',
      where: 'userName = ? AND password = ?',
      whereArgs: [username, password],
    );

    if (result!.isNotEmpty) {
      // print('resss=${result}');
      // print('resss=${result[0]}');
      // print('Model=${UserModel.fromMap(result[0])}');
      return UserModel.fromMap(result[0]);
    } else {
      return null;
    }
  }

// getQuantity() AND getIngredientQuantity() CAN BE MERGED INTO 1 FUNCTION
  Future<int> getQuantity(int orderItemId) async {
    final Database? db = await instance.database;
    final List<Map<String, Object?>>? result = await db?.query(
      'OrderItems',
      columns: ['quantity'],
      where: 'orderItemId = ?',
      whereArgs: [orderItemId],
    );
    if (result!.isNotEmpty) {
      // print(" quantity: ${result[0]['quantity']}");
      return (result[0]['quantity'] ?? 0) as int;
    } else {
      return 0;
    }
  }

// getQuantity() AND getIngredientQuantity() CAN BE MERGED INTO 1 FUNCTION
  Future<int> getIngredientQuantity(int purchaseItemId) async {
    final Database? db = await instance.database;
    final List<Map<String, Object?>>? result = await db?.query(
      'PurchaseItems',
      columns: ['quantity'],
      where: 'purchaseItemId = ?',
      whereArgs: [purchaseItemId],
    );
    if (result!.isNotEmpty) {
      // print(" quantity: ${result[0]['quantity']}");
      return (result[0]['quantity'] ?? 0) as int;
    } else {
      return 0;
    }
  }

  Future<int?> productCount(String prodName) async {
    final Database? db = await instance.database;
    final result = await db?.rawQuery(
        'SELECT COUNT(*) as count FROM OrderItems WHERE prodName = ?',
        [prodName]);

    if (result != null && result.isNotEmpty) {
      final count = Sqflite.firstIntValue(result);
      return count;
    }
    return -1;
  }

  Future<List<SizeModel>> getProductSizes(int productId) async {
    List<SizeModel> sizes = [];

    final Database? db = await instance.database;
    final List<Map<String, Object?>>? result = await db?.query(
      'Size',
      where: 'productId = ?',
      whereArgs: [productId],
      orderBy: 'unitCost ASC',
    );

    if (result != null) {
      for (var size in result) {
        sizes.add(SizeModel.fromMap(size));
      }
    }
    // print('SSS=$sizes');
    return sizes;
  }

  Future<int?> ingredientCount(int ingredientId) async {
    final Database? db = await instance.database;
    final result = await db?.rawQuery(
        'SELECT COUNT(*) as count FROM PurchaseItems WHERE ingredientId = ?',
        [ingredientId]);

    if (result != null && result.isNotEmpty) {
      final count = Sqflite.firstIntValue(result);
      return count;
    }
    return -1;
  }

  Future<void> truncateTable(String dbTable) async {
    final Database? db = await instance.database;
    await db?.rawDelete('DELETE FROM $dbTable');
  }

  Future<List<Map<String, dynamic>>?> queryDatabase(dbTable) async {
    Database? db = await instance.database;
    return await db?.query(dbTable);
  }

  Future<void> deleteDatabase() async {
    Directory directory = await getApplicationCacheDirectory();
    String path = join(directory.path, dbName);
    return databaseFactory.deleteDatabase(path);
  }
